import React, { useState } from 'react';
import { Sidebar } from 'primereact/sidebar';
import { Button } from 'primereact/button';
import 'primeicons/primeicons.css';
import { RouterProvider, createBrowserRouter } from 'react-router-dom';



const router=createBrowserRouter([
    {
      path:'/receipt',
      element:<Form/>
    },

]);
export function SideBarAdmin() {
    const [visible, setVisible] = useState(false);

    return (

        <RouterProvider router={router}>
        <div className="card flex justify-content-center">
            <Sidebar visible={visible} onHide={() => setVisible(false)}>
                <h2>Sidebar</h2>
                <li>
                        <a router={router}  className="p-ripple flex align-items-center cursor-pointer p-3 border-round text-700 hover:surface-100 transition-duration-150 transition-colors w-full">

                        <span className="font-medium">Dashboard</span>

                                                    </a>
                                                </li>
            </Sidebar>
            <Button className=" pi pi-arrow-right" onClick={() => setVisible(true)} />
        </div>
        </RouterProvider>
    )
}
